import React from 'react'
import './App.css'

import { getPokemon } from './actions/index.js'
import API from './API'

const App = () => {
  const handleClick = () => {
    return API.getFirstTwentyPokemon()
      .then(resp => resp.json())
      .then(pokemon => getPokemon(pokemon))
  }

  return (
    <div className='App'>
      <button onClick={handleClick}>GET POKEMON</button>
    </div>
  )
}

export default App
